  <h4>Kudeatu babeskopia fitxategiak</h4>
  <p>Hemen, babeskopia fitxategi zaharrak kendu ditzakezu.</p>
  <p>Aurreko bertsio batera ere atzera egin dezakezu. Bertsio berriarekin arazo larriak badituzu bakarrik atzera egitea kontuan hartu.</p>
